import React from 'react';
import {Router} from '@reach/router';



import Header from './elements/Header'
import Home from './Home'


import {GlobalStyle} from './styles/GlobalStyle'


const App = () => (
    <React.Fragment>
        <Header/>
        <Router>
            <Home path="/"/>
        </Router>
        <Home/>
        <GlobalStyle/>
    </React.Fragment>
);

export default App;
